import React from "react";
import Slider from "react-slick";
import rapperImage from "../../resources/HomeSlider/Rapper-bohemia.jpg";
import djImage from "../../resources/HomeSlider/nucleya-in-action.jpg";
import bboyImage from "../../resources/HomeSlider/bboying girl.jpg";
import beatBoxerImage from "../../resources/HomeSlider/indian-beatboxer.jpg";
import GrafImage from "../../resources/HomeSlider/Grafeti.jpg";

const HomeSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div style={{ "background-color": "white" }} className="px-5 py-2">
      <Slider {...settings}>
        <div class="col-lg-12 text-center p-0 d-flex align-items-center card">
          <img
            class="img-fluid position-relative mx-auto card-img"
            src={rapperImage}
            alt=""
          />
          <div className="card-img-overlay overlay-grey text-white d-flex justify-content-center align-items-end">
            <h2>MC</h2>
          </div>
        </div>
        <div class="col-lg-12 text-center p-0 d-flex align-items-center">
          <img
            class="img-fluid position-relative mx-auto card-img"
            src={djImage}
            alt=""
          />
          <div className="card-img-overlay overlay-grey text-white d-flex justify-content-center align-items-end">
            <h2>DJing</h2>
          </div>
        </div>
        <div class="col-lg-12 text-center p-0 d-flex align-items-center">
          <img
            class="img-fluid position-relative mx-auto card-img"
            src={bboyImage}
            alt=""
          />
          <div className="card-img-overlay overlay-grey text-white d-flex justify-content-center align-items-end">
            <h2>B-Boying</h2>
          </div>
        </div>
        <div class="col-lg-12 text-center p-0 d-flex align-items-center">
          <img
            class="img-fluid position-relative mx-auto card-img"
            src={beatBoxerImage}
            alt=""
          />
          <div className="card-img-overlay overlay-grey text-white d-flex justify-content-center align-items-end">
            <h2>Beat-Boxing</h2>
          </div>
        </div>
        <div class="col-lg-12 text-center p-0 d-flex align-items-center">
          <img
            class="img-fluid position-relative mx-auto card-img"
            src={GrafImage}
            alt=""
          />
          <div className="card-img-overlay overlay-grey text-white d-flex justify-content-center align-items-end">
            <h2>Graftie</h2>
          </div>
        </div>
      </Slider>
    </div>
  );
};

export default HomeSlider;
